file:
  statement:
    select_statement:
      select_clause:
      - keyword: select
      - select_clause_modifier:
        - keyword: distinct
        - keyword: 'on'
        - bracketed:
          - start_bracket: (
          - expression:
              column_reference:
                naked_identifier: id
          - end_bracket: )
      - select_clause_element:
          expression:
            cast_expression:
              bracketed:
                start_bracket: (
                expression:
                - column_reference:
                    naked_identifier: json
                - binary_operator: ->
                - quoted_literal: "'type'"
                - binary_operator: ->>
                - quoted_literal: "'id'"
                end_bracket: )
              casting_operator: '::'
              data_type:
                keyword: int
          alias_expression:
            alias_operator: as
            naked_identifier: id
      - comma: ','
      - select_clause_element:
          expression:
            bracketed:
              start_bracket: (
              expression:
              - column_reference:
                  naked_identifier: json
              - binary_operator: ->
              - quoted_literal: "'type'"
              - binary_operator: ->>
              - quoted_literal: "'name'"
              end_bracket: )
          alias_expression:
            alias_operator: as
            naked_identifier: name
      from_clause:
        keyword: from
        from_expression:
          from_expression_element:
            table_expression:
              bracketed:
                start_bracket: (
                select_statement:
                  select_clause:
                    keyword: select
                    select_clause_element:
                      wildcard_expression:
                        wildcard_identifier:
                          star: '*'
                  from_clause:
                    keyword: from
                    from_expression:
                      from_expression_element:
                        table_expression:
                          table_reference:
                            naked_identifier: sb_route_events
                        alias_expression:
                          alias_operator: as
                          naked_identifier: s
                  where_clause:
                    keyword: where
                    bracketed:
                      start_bracket: (
                      expression:
                      - column_reference:
                        - naked_identifier: s
                        - dot: .
                        - naked_identifier: match_id
                      - keyword: not
                      - keyword: in
                      - bracketed:
                        - start_bracket: (
                        - select_statement:
                            select_clause:
                              keyword: select
                              select_clause_modifier:
                                keyword: distinct
                              select_clause_element:
                                column_reference:
                                  naked_identifier: match_id
                            from_clause:
                              keyword: from
                              from_expression:
                                from_expression_element:
                                  table_expression:
                                    table_reference:
                                      naked_identifier: this_model
                        - end_bracket: )
                      end_bracket: )
                end_bracket: )
            alias_expression:
              alias_operator: as
              naked_identifier: e
